  false,\n\t\"url\": null,\n\t\"notes\": \"The Natural Resources and Conservation
  Planning Division of the National Wildlife Refuge System, in cooperation with 19
  refuges across 6 regions, has established a Wilderness Fellowship Program to provide
  opportunities for students to gain valuable career experience while helping advance
  stewardship of wilderness resources. Each Wilderness Fellow will spend up to six
  months in a wilderness refuge to support the development of wilderness character
  monitoring and associated tasks. Fellows will have the opportunity to take part
  in training courses, develop an inventory and monitoring strategy, produce baseline
  wilderness character data and assessments, and gain a better understanding of U.S.
  Fish and Wildlife Service culture.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
